import React from "react";
//Material UI
import Drawer from "@material-ui/core/Drawer";
//Local Components

const Options = ({ open, setOpen_Drawer }) => {
	const handle_Close = () => {
		setOpen_Drawer(false);
	};

	return (
		<div>
			<Drawer open={open} onClose={handle_Close}>
				Hello
			</Drawer>
		</div>
	);
};

export default Options;
